import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';
import Card from './components/Card/card';
import Jumbotron from './components/Jumbotron/index.js';


//initializing app function
//defining photos to be used in game, with cooresponding ids. setting array for later score keeping
function App() {
  const [state, setState] = useState({
    pics:[
    {id:1, url: "data:image/jpeg;base64,"},
    {id:2, url: "data:image/jpeg;base64,"},
    {id:3, url: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQ0xcuF3aEXwPfkbDpSTJTRea2WYdWhtmWJtrEfUeVHphNd75n-"},
    {id:4, url: "data:image/jpeg;base64,"},
    {id:5, url: "data:image/jpeg;base64,"},
    {id:6, url: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTJcVcTbcsgOPA2Mc1PwYukpx0jz1LeOHNbkgvsqO1iuxJdPogA"},
    {id:7, url: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRbAto-MBxZgtd2kmf-G5uZhZWhEZ2IGKWoxvPcgDsN32ueY6fy"},
    {id:8, url: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcT1DN7lDUzRdiAd0r3jexIPD9tJaCMibXeKrLTFhYe_HrzNgdL0"},
    {id:9, url: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRXbpqCfPSsmUz56LXgAb_FqdQYR7k2MhRvGtXqQQVcwnJcAZeu"},
    {id:10, url: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQ0yFK1XkrNkSZIEPjIbb6zpjg9cYGoSdnNPZdDqpO7lQVQ1XU1"},
    {id:11, url: "data:image/jpeg;base64,"},
    {id:12, url:"https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQxDWf2NmjySqO5vgrajhwRJLYzulXZdbxKYgSlTQk_ySsPUTuJ"}
  ], 
  beenClicked:[],
  gameOver: false
}) 
const originalState = [state, setState];

// function to allow photos array to be shuffled
  function shuffle(array) {
    var currentIndex = array.length, temporaryValue, randomIndex;
    // While there remain elements to shuffle...
    while (0 !== currentIndex) {
      // Pick a remaining element...
      randomIndex = Math.floor(Math.random() * currentIndex);
      currentIndex -= 1;
  
      // And swap it with the current element.
      temporaryValue = array[currentIndex];
      array[currentIndex] = array[randomIndex];
      array[randomIndex] = temporaryValue;
    }
    return array;
  }

// handling clicks within the game & connecting function to overall state & picture array
  const handleClick = (id) => {
    // console.log("you got clicked", id);
    var newPics = state.pics;
    //linking above shuffle function to our picture array
    var shufflepics = shuffle(newPics);
    var newClicks = state.beenClicked;
    // comparing if a picture has already been clicked, if so, you lose
    if(newClicks.indexOf(id) === -1)  {
      newClicks.push(id);
    setState({...state, pics:shufflepics, beenClicked:newClicks})
    } else {
      setState({...state, beenClicked:[], gameOver:true},function(){
        console.log("happened after update");
      });
    }
  }

  const hideGameOver = () => {
    setTimeout(function(){
      console.log("hide game over");
      setState({...state, beenClicked:[], gameOver:false})
    }, 3000)
  }

  var gameOver = (<h1 className="fonts">Game Over</h1>) 
    if(state.gameOver === true){
      hideGameOver();
    }

  return (
    
    <div className="App">
      <div>
        <Jumbotron />
      </div>
      <div>
        {state.gameOver === true ? gameOver : ""}
        <h1 className="fonts">Score: {state.beenClicked.length}</h1>
      </div>
      <div className="cardWrapper">
        {state.pics.map((singlepic) => {
          return (
            <div>
            <Card src ={singlepic.url} click ={handleClick} id ={singlepic.id}/>
            </div>
            )
          })}
        </div>
    </div>
  );
}

export default App;
